// Playlist.js
import React from 'react';

function Playlist() {
  // Ganti dengan lagu-lagu favoritmu
  const songs = [
    { title: 'Lagu Favorit 1', url: '/assets/music/lagu1.mp3' },
    { title: 'Lagu Favorit 2', url: '/assets/music/lagu2.mp3' },
  ];
  return (
    <section style={{margin: '2rem 0'}}>
      <h2>Playlist Tahun Baru</h2>
      <ul style={{listStyle: 'none', padding: 0}}>
        {songs.map((s, i) => (
          <li key={i} style={{margin: '1rem 0'}}>
            <strong>{s.title}</strong>
            <audio controls src={s.url} style={{display: 'block', marginTop: 4}} />
          </li>
        ))}
      </ul>
    </section>
  );
}

export default Playlist;
